import React, { Component } from "react";
import "../css/App.css";
import ApiService from "../service/ApiService";
import { Redirect, Link } from "react-router-dom";
import {
  SESSION_STORAGE_TOKEN,
  SESSION_STORAGE_USERNAME
} from "../constants/Constants";
import "../css/App.css";
import { SideMenu } from "./pageComponents/SideMenu";
import { RightMenu } from "./pageComponents/RightMenu";
import { ChildForm } from "./pageComponents/ChildForm";
import Welcome from "./pageComponents/Welcome";
import { Alert } from "reactstrap";
import _ from "lodash";

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstName: "",
      lastName: "",
      email: "",
      child: [],
      redirect: false,
      isOpen: false
    };
  }
  openPopup = () => {
    this.setState({ isOpen: true });
  };
  closePopup = () => {
    this.setState({ isOpen: false });
  };
  logoutHandler = e => {
    sessionStorage.removeItem(SESSION_STORAGE_TOKEN);
    sessionStorage.removeItem(SESSION_STORAGE_USERNAME);
    this.setState({
      firstName: "",
      lastName: "",
      email: "",
      child: [],
      redirect: true
    });
  };

  componentDidMount() {
    if (
      sessionStorage.getItem(SESSION_STORAGE_TOKEN) &&
      sessionStorage.getItem(SESSION_STORAGE_USERNAME)
    ) {
      const token = sessionStorage.getItem(SESSION_STORAGE_TOKEN);
      const data = sessionStorage.getItem(SESSION_STORAGE_USERNAME);

      console.log("username:", data);
      console.log("token", token);

      ApiService.getParentData(data).then(response => {
        this.setState({
          firstName: response.data.firstName,
          lastName: response.data.lastName,
          email: response.data.email,
          child: response.data.child
        });
      });
    } else {
      this.setState({ redirect: true });
    }
  }
  render() {
    if (this.state.redirect) {
      return <Redirect to={"/"} />;
    }
    const fnameCamelcased = _.startCase(_.camelCase(this.state.firstName));
    const hasChild = this.state.child.length === 0;

    return (
      <div>
      <nav className="js-mega-menu navbar navbar-expand-lg g-brd-y g-brd-2 g-brd-primary-dark-v1 g-bg-primary g-pa-0 hs-menu-initialized hs-menu-horizontal">
          <div className="container-fluid">

            <button className="navbar-toggler navbar-toggler-right btn g-line-height-1 g-brd-none g-pa-0" type="button" aria-label="Toggle navigation" aria-expanded="false" aria-controls="navBar" data-toggle="collapse" data-target="#navBar">
              <span className="hamburger hamburger--slider g-px-0">
                <span className="hamburger-box">
                  <span className="hamburger-inner"></span>
                </span>
              </span>
            </button>


            <div className="col-auto order-lg-1">
